import { useState, useEffect } from "react";

// List of cities
const cities = [
  "Dhaka",
  "Chattogram",
  "Sylhet",
  "Khulna",
  "Rajshahi",
  "Barishal",
  "Rangpur",
  "Mymensingh",
];

// City images mapping
const cityImages = {
  Dhaka: "data:image/jpeg;base64,",
  Chattogram: "data:image/jpeg;base64,",
  Sylhet: "data:image/jpeg;base64,",
  Khulna: "data:image/jpeg;base64,",
  Rajshahi: "data:image/jpeg;base64,",
  Barishal: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTJeZlibcgRlT3f9DbZcs9TrAZQo7ceei7cxw&s",
  Rangpur: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSkoVplX-cFl5yRHeRs1qhhojv9YRgRVrSjYw&s",
  Mymensingh: "data:image/jpeg;base64,",
};

const MostDesiredPlaces = () => {
  const [selectedCityIndex, setSelectedCityIndex] = useState(0);

  // Auto-slide effect
  useEffect(() => {
    const interval = setInterval(() => {
      setSelectedCityIndex((prevIndex) => (prevIndex + 1) % cities.length);
    }, 5000); 

    return () => clearInterval(interval);
  }, []);

  return (
    <div className="container px-4 py-10 mx-auto">
      {/* Section Title */}
      <h2 className="text-3xl font-bold text-center">Explore Popular Cities</h2>
      <p className="max-w-2xl mx-auto mt-2 text-center text-gray-600">
        Bangladesh is a beautiful country in South Asia outside the tourism
        radar. Within it lies primal swamps, lush plantations, glorious beaches,
        and deep-water whales.
      </p>

      {/* City Selection Buttons */}
      <div className="flex flex-wrap justify-center gap-3 mt-5">
        {cities.map((city, index) => (
          <button
            key={city}
            className={`px-4 py-2 rounded-full border ${
              selectedCityIndex === index
                ? "bg-green-500 text-white"
                : "bg-gray-200 text-gray-800"
            }`}
            onClick={() => setSelectedCityIndex(index)}
          >
            {city}
          </button>
        ))}
      </div>

      {/* Carousel Section */}
      <div className="grid grid-cols-2 sm:grid-cols-3 lg:grid-cols-4 gap-6 mt-8">
        {cities.map((city, index) => (
          <div
            key={city}
            className={`relative rounded-lg overflow-hidden shadow-lg ${
              selectedCityIndex === index ? "ring-4 ring-green-500" : ""
            }`}
          >
            <img
              src={cityImages[city]}
              alt={`Explore ${city}`}
              className="object-cover w-full h-48"
            />
            <div className="absolute bottom-0 left-0 right-0 bg-black bg-opacity-50 text-white text-center py-2">
              <h3 className="text-xl font-bold">{city}</h3>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default MostDesiredPlaces;
